import React from "react";
import "../styles/Footer.css";
import SocialBar from "./SocialBar";

const Footer = () => {
  return (
    <footer className="main-footer">
      <div classname="social-media">
        <SocialBar />
      </div>

      
    </footer>
  );
};

export default Footer;
